	Integer[] x1 = {2,3,1}, nil = null;
	test(x1).all(x -> x < 4);
	assertThrown(()->test(x1).all(x -> x < 3)).message().is("Array contained non-matching value at index 1.\n\tUnexpected value: '3'.");
